import React,{ useState,useEffect } from 'react';

const Body=()=>{


    const [createtext,setCreatetext]=useState(0)
    const [textlist,setTextlist]=useState([1,2,3])

    const countUp=()=>{
        setCreatetext(prevState => prevState+1)
        setTextlist(prevList=>[prevList,createtext])
    }
    const countDown=()=>{
        setCreatetext(prevState => prevState-1)
        setTextlist(prevList=>prevList.pop())
    }
    let textcount=(<div>{createtext}</div>);
    useEffect(()=>{ 
        textlist.push(1)  
    },[createtext])
    console.log(textlist);
    return(
        <body className="App-body">
            <button onClick={countUp}>Up</button>
            <button onClick={countDown}>down</button>
            {textcount}
            {textlist.map((textitem)=>{
                return(
                    <div>{textitem}<br>aaa</br></div>
                )
            })}
        </body>
    );
}
export default Body;
